(window["webpackJsonp"]=window["webpackJsonp"]||[]).push([["lang-de-json"],{"6ce2":function(e){e.exports=JSON.parse('{"title":"Álan Crístoffer","public":"Öffentlich","gpg_public_key":"GPG öffentlicher Schlüßel","pt":"Portugiesisch","en":"Englisch","fr":"Französisch","de":"Deutsch","native":"Muttersprache","about_me":"Ich bin ein Doktorand arbeitet an Angriffserkennung und -minderung auf Cyber-Physical Systems. Ich bin eine introvertierte Person, die kooperative Umgebungen mag. Ich genieße es zu programmieren (damit ich die langweiligen Aufgaben automatisieren kann) und Sprachen zu lernen (damit ich in ihnen schweigen kann).","languages":"Sprachen","tests_database_desc":"Fragen verwalten und Prüfungen drucken.","tb_ss1_desc":"Diese Anwendung wurde für den Feuerwehrmänner des Bundesstaates Minas Gerais/Brasilien entwickelt, um die Tests der Newcomern und die jährlichen Tests zu verwalten.","tb_ss2_desc":"Sie können die Prüfungen uber ein einfaches Interface vorbereiten. Die Antworten können diskursiven oder objektiven sein. Die Auswahl der Fragen kann automatiziert werden oder von Hand gemacht. Und die Bewertung ist natürlich einfach gemacht.","tb_ss3_desc":"Fragen können mit einem WYSIWYG-Textfeld hinzugefügt werden, das die Erzeugung der reichstylische Prüfungen ermöglicht.","and":"und","cefss_desc":"Der Quellcode einer minimalen Anwendung, damit Sie mit Chromium Embedded Framework-Versionen 1 und 3 beginnen können. Setzt sich ein Fenster, lädt eine HTML-Datei und erstellt eine bidirektionale Verbindung zwischen Javascript und C++, um die Grundlagen von einem C++ Anwendung mit HTML-UI zu zeigen.","ahio_desc":"ahio ist eine Kommunikation-Bibliothek, deren Ziel die Verbindung mit verschiedener I/O Hardwares einfacherer zu machen ist, um Hardware-Veränderungen mit minimaler Code Änderung möglich zu machen.","moirai_desc":"Moirai ist das Backend der Kontrollplattform. Es wurde im Rahmen meines wissenschaftlichen Initiationsprojekts Plataformas de baixo custo para controle de processos (kostengünstige Plattform für die Prozesskontrolle) entwickelt, das am CEFET-MG (Brasilien) unter der Leitung von Prof. Dr. Valter Leite entwickelt wurde. Das Projekt wurde im Rahmen eines FAPEMIG-Stipendiums entwickelt. Controller für diese Plattform sind in Python 3 geschrieben und können jede Bibliothek verwenden, die auf dem Computer verfügbar ist, auf dem moirai läuft. Es hängt bereits von NumPy und SciPy ab, wie sie üblicherweise verwendet werden. Diese Plattform verwaltet die Hardware-Schnittstellen über die ahiio libray, so dass die Erweiterung der Hardwarefähigkeiten eine Frage der Erweiterung von AHIO ist, die einfach sein sollte. Ausführungszeit, Abtastzeit, Eingabeabfrage und Ausgabeaktualisierung werden von der Anwendung verwaltet und Sie können sich auf Ihren Controller/Ihr Modell konzentrieren.","lachesis_desc":"Lachesis ist das Frontend der Steuerungsplattform. Mit dieser Anwendung können Sie die Hardware konfigurieren, Systemantwortetests durchführen und Controller mit einer benutzerfreundlichen Oberfläche ausführen. Die verwendeten Ein- und Ausgangssignale sowie Variablen können grafisch dargestellt und in Echtzeit aktualisiert werden. Es funktioniert nur als Frontend, dass heißt alle Daten werden im Moirai-Server gespeichert und verwaltet. Der Server ist auch für die Ausführung des Controllers verantwortlich. Das bedeutet, dass Sie moirai in einem dedizierten Computer, wie einem Raspberry Pi, und Lachesis in einem anderen installieren können, indem Sie Lachesis wie eine Fernbedienung für Ihr Kontrollsystem verwenden. Dies ermöglicht verschiedenen Benutzern, die Anlagenkonfiguration zu teilen.","lachesis1_desc":"Das Einrichten der Hardware ist so einfach wie das Ausfüllen eines Formulars.","lachesis2_desc":"Visualisieren Sie die Steuerungswellenform vor dem Ausführen von Open-Loop-Tests.","lachesis3_desc":"Wählen Sie einfach die Abtastzeit, Ausführungsdauer und Eingaben. Sie müssen sich nicht darum kümmern, diese zu handhaben. Jetzt können Sie sich auf Ihren Controller konzentrieren, der in Python 3 geschrieben werden kann, einer hochentwickelten und modernen Programmiersprache.","lachesis4_desc":"Visualisieren Sie Eingaben, Ausgaben und protokollierte Variablen grafisch in Echtzeit. Wenn der Test beendet ist, können die Daten in JSON, CSV und MAT exportiert werden.","tracker_desc":"Anwendung zum Verfolgen von Paketen mit Correios-Site als Backend. Es funktioniert nicht mehr, da es keinen Sinn macht, es zu aktualisieren, jetzt, wo Correios eine eigene Anwendung hat. Der Quellcode wird jedoch zu Referenzzwecken auf GitHub gespeichert.","void_desc":"Void ist ein verschlüsselter Speicher. Sie können Dateien vom/zum Speicher verschlüsseln/entschlüsseln. Die Verschlüsselung wird von NSS/NSPR unter Verwendung von AES_GCM_256, SHA512, PKCS5_PBKDF2, HMAC_SHA512 mit einem Kostenaufwand von 250000 ausgeführt. Das Geschäft selbst hat einen Schlüssel, der von Ihrem Kennwort abgeleitet wird, und jede Datei hat ihren eigenen Zufallsschlüssel. Auf der Festplatte erhalten alle verschlüsselten Dateien einen 128-stelligen Salted-Hash-Namen. Große Dateien (50 MB) werden in kleinere Teile aufgeteilt.","void1_desc":"Sie können Dateien und Ordner verschlüsseln und sogar Metadaten wie Tags und Kommentare festlegen.","void2_desc":"Textdateien können innerhalb der Anwendung mit dem Ace-Editor bearbeitet werden, der das Theming und die Syntaxhervorhebung für 161 Sprachen unterstützt.","void3_desc":"Sie können Dateien durchsuchen, indem Sie deren Pfad, Tags und Kommentare abgleichen.","void4_desc":"Videos können innerhalb der Anwendung abgespielt werden, ohne die Festplatte zu berühren. Bilder können auch karussellartig dargestellt werden.","sigaa_desc":"Web Scraper, der Noten aus dem CEFET-MG SIGAA-Portal extrahiert und es den Schülern ermöglicht, Noten, Zeitpläne und Häufigkeit auf einer Oberfläche zu sehen, auch wenn sie offline sind.","sigaa_notas1_desc":"Der Student kann seine Immatrikulation auswählen, wenn es mehr als eine gibt.","sigaa_notas2_desc":"Noten aller Fächer werden auf einer einzigen Oberfläche angezeigt.","sigaa_notas3_desc":"Die Zeitpläne werden nach Tag sortiert angezeigt, damit sie leicht gelesen werden können.","sigaa_notas4_desc":"Die Frequenz ist auch auf einem einzelnen Bildschirm verfügbar, aber denken Sie daran, dass hier nur die Eingaben des Professors angezeigt werden!","%d years old, Brazilian":"%d Jahre alt, Brasilianer","contacts":"Kontakte","skills":"Fähigkeiten","site_languages":"Sprache der Seite","$skills":"Systemanalyse und -steuerung, C/C++, Python, Kotlin, Assembly, MATLAB, Android-Entwicklung, Frontend, Backend, Embedded, Automatisierung, Robotik","about":"Über","resume":"Lebensläufe","projects":"Projekte","publications":"Publikationen","experience":"Ausbildung/Erfahrungen","experience_title":"Erfahrungen","education":"Ausbildung","intern":"Praktikant","acal_desc":"Durch dieses Praktikum habe ich eine Messplattform für PFC-Drossel Kernverluste gebaut.","soldier":"Soldat","cbmmg_desc":"Als Feuerwehrmann war ich berechtigt, als Ersthelfer und Taucher zu arbeiten. Ich var der Ersthelfer bei allen möglichen Unfällen, vom Feuer in der Wildnis über Autounfälle bis hin zu Industrie- und Naturkatastrophen.","eng_meca":"Mecatroniker","mes_control":"Master in Elektrotechnik","cefet_mes_desc":"Masterstudent unter der Leitung von Prof. Dr. Valter Leite und Prof. Dr. Walter Lucia zur Erforschung der fehlertoleranten Steuerung in zustandsbeschränkten vermittelten Systemen.","cefet_desc":"Als Student habe ich in meinem zweiten Jahr angefangen, an Aktivitäten teilzunehmen, als Teil des Teams, das den 3. Platz im lateinamerikanischen Roboterwettbewerb gewann. Danach half ich den Studentenvertretern bei einigen Aktivitäten, ohne Mitglied zu werden, bis ich Graduierungsrat endlich übergennomen habe. Seit meinem ersten Semester habe ich anderen Graduirung und Meister Studenten mit ihrer Projekte geholfen, besonders mit Programmierung.","cefet_items":["Robotik-Lernengruppe (2014)","Tutor für Computerprogrammierung für Studierende der Mechatronik und Informatik (Fachkurs) (2014)","3. Platz beim Latin America Robotic Competition (2014)","Studentaustausch an der Université Joseph Fourier (Grenoble, Frankreich) (2015)","Studentaustausch an der Frankfurt University of Applied Sciences (Frankfurt, Deutschland) (2015/16)","Wissenschaftliche Initiation: Kostengünstige Prozesssteuerungsplattform (2017)","Wissenschaftliche Initiation: Prozesssteuerungsplattform: eine MPC-Implementierung (2018)","Studentisches Mitglied des Graduierungsrates (2018/19)","Berater eines BIC-Jr mit dem Titel \'Systemmodellierung für die Prozesssteuerung\' (2018)","Berater eines BIC-Jr mit dem Titel \'Modellierung eines Ofens mit raumverteilten Parametern\' (2019)","Berater eines BIC-Jr mit dem Titel \'Steuerung eines gekoppelten Panzersystems\' (2019)"],"exchange_student":"Studentaustausch","fuas_desc":"Ich habe als Austauschstudent im Rahmen des Programms Ciências Sem Fronteiras (Wissenschaft ohne Grenzen) der brasilianischen Regierung studiert.","uga_desc":"Ich habe als Austauschstudent durch die Partnerschaft zwischen UGA und CEFET-MG studiert. Dort arbeitete ich im Robotiklabor und half dem Team, das den zweiten Platz beim National Instruments MyRIO Paris-Wettbewerb belegte.","phd_control":"Doktorat in Elektrotechnik","phd_desc":"Doktorand unter der Leitung von Prof. Dr. Nadhir Messai und Prof. Dr. Nouredinne Manamanni zur Erforschung der Erkennung und Abschwächung von Angriffen auf cyber-physikalische Systeme."}')}}]);
